customLognObj = {'ks_log':loss_logn.ks_log}
logn_models = os.listdir(logn_path)
feat, runs, locs = f.createRuntimeData_logn()
for file in logn_models:
    too_low = 0
    if not os.path.isfile(logn_path+file):
        continue
    (mean, var) = logn_dict[file]

    # Normalize the features.
    X, mean, var = f.normalize(feat, mean, var)

    # Load a lognormal NN model and predict the parameters.
    model = load_model(logn_path + file, custom_objects = customLognObj)
    predictions = model.predict(np.array(X))

    # The outputs of the lognormal NN are in the range (0,1).
    # The following functions map them to the actual values.
    scales = [scale_calc_logn(x[0]) for x in predictions]
    shapes = [shape_calc_logn(x[1]) for x in predictions]


    restarts = []
    speedup = []
    for i in range(len(scales)):
        # For each estimate a restart time is calculated.
        # This restart time is then evaluated on the empirical runtime observations.
        # We obtain an average speedup estimate.
        restarts.append(lognormRestartTime(scales[i], shapes[i], locs[i]))
        if restarts[i] >= np.min(runs[i]):
            # It is possible that a restart time smaller than the lowest observed runtime is obtained.
            # Then, the (empirical) average speedup is undefined. We skip these cases.
            too_low += 1
            speedup.append(calculate_mean(restarts[i], runs[i]))

    # The average speedup (geometric mean) is obtained by first taking the logarithm...
    speedup = np.log(speedup)
    # ... then calculating the mean and lastly using the exp function.
    print(file ,np.exp(np.mean(speedup)))
    print(str(too_low)+"-times high enough.")